Example 1: Compute Duration from two Timestamps in pseudo code. Timestamp start = ...;
Timestamp end = ...;
Duration duration = ...; duration.seconds = end.seconds - start.seconds;
duration.nanos = end.nanos - start.nanos; if (duration.seconds &lt; 0 &amp;&amp; duration.nanos &gt; 0) { duration.seconds &#43;= 1; duration.nanos -= 1000000000;
} else if (duration.seconds &gt; 0 &amp;&amp; duration.nanos &lt; 0) { duration.seconds -= 1; duration.nanos &#43;= 1000000000;
} Example 2: Compute Timestamp from Timestamp + Duration in pseudo code. Timestamp start = ...;
Duration duration = ...;
Timestamp end = ...; end.seconds = start.seconds &#43; duration.seconds;
end.nanos = start.nanos &#43; duration.nanos; if (end.nanos &lt; 0) { end.seconds -= 1; end.nanos &#43;= 1000000000;
} else if (end.nanos &gt;= 1000000000) { end.seconds &#43;= 1; end.nanos -= 1000000000;
} Example 3: Compute Duration from datetime.timedelta in Python. td = datetime.timedelta(days=3, minutes=10)
duration = Duration()
duration.FromTimedelta(td)

